import React, { useState, useEffect } from "react";
import { performAnalysis } from "./AnalysisGet";

const AnalysisDisplay = () => {
  const [analysisResults, setAnalysisResults] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const results = await performAnalysis();
        setAnalysisResults(results);
      } catch (err) {
        setError(err);
      }
    };

    fetchData();
  }, []);

  // Format numbers with fallback to $0.00 or N/A for non-numeric values
  const formatValue = (value, isCurrency = false) => {
    if (isNaN(value) || value === undefined) {
      return isCurrency ? "$0.00" : "N/A";
    }
    return isCurrency ? `$${value.toFixed(2)}` : `${value.toFixed(2)}`;
  };

  // Keep the structure even if there's an error
  if (error) {
    console.error("Error fetching analysis data:", error); // Log error
  }

  if (!analysisResults && !error) {
    return <div>Loading...</div>;
  }

  // Destructure analysisResults with fallback values
  const {
    numberOfTrades = 0,
    winningTrades = 0,
    losingTrades = 0,
    winRate = 0,
    averageWin = 0,
    averageLoss = 0,
    riskRewardRatio = 0,
  } = analysisResults || {};

  return (
    <div className="analysis-container">
      <div className="analysis-row">
        <div className="analysis-circle">
          <h3>Trades</h3>
          <p>{numberOfTrades}</p>
        </div>
        <div className="analysis-circle">
          <h3>Wins</h3>
          <p>{winningTrades}</p>
        </div>
        <div className="analysis-circle">
          <h3>Losses</h3>
          <p>{losingTrades}</p>
        </div>
      </div>

      <div className="analysis-metrics-row">
        <div className="analysis-metric">
          <h3>Win Rate</h3>
          <p>{formatValue(winRate)}%</p>
        </div>
        <div className="analysis-metric">
          <h3>Avg. Win</h3>
          <p>{formatValue(averageWin, true)}</p>
        </div>
        <div className="analysis-metric">
          <h3>Avg. Loss</h3>
          <p>{formatValue(averageLoss, true)}</p>
        </div>
        <div className="analysis-metric">
          <h3>Risk Reward</h3>
          <p>{formatValue(riskRewardRatio)}</p>
        </div>
      </div>
    </div>
  );
};

export default AnalysisDisplay;

